import { useState } from "react";
import style from "../Authentication/Authentication.module.css";
function Profile(props) {
  const [username, setUsername] = useState(props.username);
  const [city, setCity] = useState(props.city);
  const [phoneNumber, setPhoneNumber] = useState(props.phoneNumber);
  const [birthday, setBirthday] = useState(props.birthday);
  const [linkFacebook, setLinkFacebook] = useState(props.linkFacebook);
  const [linkLinkedIn, setLinkLinkedIn] = useState(props.linkLinkedIn);
  const [linkInstagram, setLinkInstagram] = useState(props.linkInstagram);

  return (
    <div>
      <div className={style.container}>
        <div className={style.customContainer}>
          <div className={style.login_container}>
            <div className={style.registration}>
              <div className={style.title}>Enter your profile</div>
              <div className={style.input}>
                <div className={style.inputContainer}>
                  <div className={style.customInput}>
                    <input
                      value={email}
                      onInput={(evt) => setEmail(evt.target.value)}
                      type="text"
                      placeholder="Email"
                    />
                  </div>
                </div>
                <div className={style.inputContainer}>
                  <div className={style.customInput}>
                    <input
                      value={password}
                      onInput={(evt) => setPassword(evt.target.value)}
                      type="text"
                      placeholder="Password"
                    />
                  </div>
                </div>
                <div className={style.buttonContainer}>
                  <button
                    onClick={() => {
                      props.login({
                        email,
                        password,
                      });
                    }}
                    className={style.button}
                  >
                    Login
                  </button>
                </div>
                <div className={style.link}>
                  <div>Don't have a profile yet?</div>
                  <NavLink to="/auth/registration">
                    <div className={style.linkClick}> Register now</div>
                  </NavLink>
                </div>
              </div>
            </div>
          </div>

          <div></div>
        </div>
      </div>
    </div>
  );
}
export default Profile;
